INSERT INTO `sys_quotes` (`quote_UUID`, `quote_person`, `quote`, `deleted`, `added_by`, `added_date`, `modified_by`, `modified_date`) VALUES
('c4975891-9f78-11e5-a575-38b1dbe2bc0e', 'Buddha', 'There are only two mistakes that one can make along the road to truth; not going all the way, and not starting.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('c4987af6-9f78-11e5-a575-38b1dbe2bc0e', 'Lao Tzu', 'Do the difficult things while they are easy and do the great things while they are small. A journey of a thousand miles must begin with a single step.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('c49912b2-9f78-11e5-a575-38b1dbe2bc0e', 'Henry Ford', 'Failure is simply the opportunity to begin again, this time more intelligently.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('c49ade18-9f78-11e5-a575-38b1dbe2bc0e', 'Walt Disney', 'The way to get started is to quit talking and begin doing.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('c49d12ff-9f78-11e5-a575-38b1dbe2bc0e', 'F. Scott Fitzgerald', 'Vitality shows in not only the ability to persist, but the ability to start over.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('c49d9ff0-9f78-11e5-a575-38b1dbe2bc0e', 'Ernest Hemmingway', 'All things truly wicked start from innocence.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('c49e2d67-9f78-11e5-a575-38b1dbe2bc0e', 'Thomas A. Edison', 'Our greatest weakness lies in giving up. The most certain way to succeed is to always to try one more time.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('c49ebfe5-9f78-11e5-a575-38b1dbe2bc0e', 'Samuel Beckett', 'Ever tried. Ever failed. No matter. Try again. Fail again. Fail better.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('c49f4eef-9f78-11e5-a575-38b1dbe2bc0e', 'Dr. Seuss', 'The more that you read, the more things you will know. The more that you learn, the more places you''ll go.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
