('f0130528-9f78-11e5-a575-38b1dbe2bc0e', 'Henry Ford', 'Failure is simply the opportunity to begin again, this time more intelligently.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f013a44b-9f78-11e5-a575-38b1dbe2bc0e', 'Walt Disney', 'The way to get started is to quit talking and begin doing.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f0144fe4-9f78-11e5-a575-38b1dbe2bc0e', 'F. Scott Fitzgerald', 'Vitality shows in not only the ability to persist, but the ability to start over.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f0164b08-9f78-11e5-a575-38b1dbe2bc0e', 'Ernest Hemmingway', 'All things truly wicked start from innocence.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f0170990-9f78-11e5-a575-38b1dbe2bc0e', 'Thomas A. Edison', 'Our greatest weakness lies in giving up. The most certain way to succeed is to always to try one more time.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f017deb3-9f78-11e5-a575-38b1dbe2bc0e', 'Samuel Beckett', 'Ever tried. Ever failed. No matter. Try again. Fail again. Fail better.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f018af6d-9f78-11e5-a575-38b1dbe2bc0e', 'Dr. Seuss', 'The more that you read, the more things you will know. The more that you learn, the more places you''ll go.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f01aa79b-9f78-11e5-a575-38b1dbe2bc0e', 'Thomas Huxley', 'Try to learn something about everything and everything about something.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f01ca85c-9f78-11e5-a575-38b1dbe2bc0e', 'Tom Hanks', 'If they could offer up a way to go to the moon that wouldn''t kill you, I''d sign up.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f01e879f-9f78-11e5-a575-38b1dbe2bc0e', 'Albert Einstein', 'You have to learn the rules of the game. And then you have to play better than anyone else.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f01f5cb2-9f78-11e5-a575-38b1dbe2bc0e', 'Pablo Picasso', 'I am always doing that which I cannot do, in order that I may learn how to do it.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f0216be2-9f78-11e5-a575-38b1dbe2bc0e', 'Mark Twain', 'The secret of getting ahead is getting started.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f0239071-9f78-11e5-a575-38b1dbe2bc0e', 'Mark Twain', 'Get your facts first, then you can distort them as you please.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f024ad50-9f78-11e5-a575-38b1dbe2bc0e', 'Audrey Hepburn', 'The most important thing is to enjoy your life - to be happy - it''s all that matters.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f025c539-9f78-11e5-a575-38b1dbe2bc0e', 'Benjamin Franklin', 'Tell me and I forget. Teach me and I remember. Involve me and I learn.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f026e287-9f78-11e5-a575-38b1dbe2bc0e', 'C.S. Lewis', 'You are never too old to set another goal or to dream a new dream.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f027fa87-9f78-11e5-a575-38b1dbe2bc0e', 'Douglas Adams', 'I love deadlines. I like the whooshing sounds they make as they fly by.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f0290f4a-9f78-11e5-a575-38b1dbe2bc0e', 'Helen Keller', 'The best and most beautiful things in the world cannot be seen or even touched - they must be felt with the heart.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f02a21e4-9f78-11e5-a575-38b1dbe2bc0e', 'J.R.R. Tolkein', 'Still round the corner there may wait, A new road or a secret gate.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f02b375d-9f78-11e5-a575-38b1dbe2bc0e', 'Julius Caesar', 'If you must break the law, do it to seize power: in all other cases observe it.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f02c5318-9f78-11e5-a575-38b1dbe2bc0e', 'Marilyn Monroe', 'Give a girl the right shoes, and she can conquer the world.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f02d6b08-9f78-11e5-a575-38b1dbe2bc0e', 'Napoleon Bonaparte', 'A leader is a dealer in hope.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f02e8176-9f78-11e5-a575-38b1dbe2bc0e', 'Oscar Wilde', 'I can resist everything except temptation.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f02f946f-9f78-11e5-a575-38b1dbe2bc0e', 'Robert Frost', 'The woods are lovely, dark and deep. But I have promises to keep, and miles to go before I sleep.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f030b107-9f78-11e5-a575-38b1dbe2bc0e', 'Robin Williams', 'No matter what people tell you, words and ideas can change the world.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f031c3c9-9f78-11e5-a575-38b1dbe2bc0e', 'Woody Allen', 'If you''re not failing every now and again, it''s a sign you''re not doing anything very innovative.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL),
('f032cf44-9f78-11e5-a575-38b1dbe2bc0e', 'Yogi Berra', 'I never said most of the things I said.', NULL, '2BAEB538094D3B46164E01DA20EA4E9C', '2015-12-10 20:07:27', NULL, NULL);
